/*Table structure for table `companies` */

DROP TABLE IF EXISTS `companies`;

CREATE TABLE `companies` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `alias` varchar(64) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `status` tinyint(3) unsigned NOT NULL,
  `meta_company_id` int(10) unsigned DEFAULT NULL,
  `created_staff_id` int(10) unsigned DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `update_staff_id` int(10) unsigned DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `delete_staff_id` int(10) unsigned DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `staff_add` varchar(255) DEFAULT '{"number":10,"text":"Text"}',
  `fax` varchar(100) DEFAULT NULL,
  `headquarters` varchar(255) DEFAULT NULL,
  `bill_to_address` varchar(255) DEFAULT NULL,
  `bill_to_destination` varchar(255) DEFAULT NULL,
  `bill_to_postal_code` varchar(100) DEFAULT NULL,
  `name_manager` varchar(255) DEFAULT NULL,
  `phone_number` varchar(100) DEFAULT NULL,
  `contract_store` int(10) DEFAULT '0',
  `billable` varchar(1024) DEFAULT NULL COMMENT '{"billable":3,"text":"abc"}',
  `postal_code_headquarters` varchar(100) DEFAULT NULL,
  `cert_add` varchar(255) DEFAULT '{"number":1,"text":""}' COMMENT '{"number":3,"text":"abc"}',
  PRIMARY KEY (`id`),
  KEY `meta_company_id` (`meta_company_id`),
